import React, { useState } from "react";

export default function App() {
  const [address, setAddress] = useState("");
  const [sourceCode, setSourceCode] = useState("");
  const [results, setResults] = useState(null);
  const [error, setError] = useState("");

  const DEMO_BSCSCAN_KEY = "Your_BscScan_API_Key"; // ƒë·ªïi th√†nh key th·∫≠t c·ªßa b·∫°n
  const DEMO_ETHERSCAN_KEY = "Your_EtherScan_API_Key"; // ƒë·ªïi n·∫øu c·∫ßn

  // ============================
  // üîç H√†m l·∫•y m√£ ngu·ªìn token
  // ============================
  async function fetchSource() {
    try {
      setError("");
      setResults(null);
      setSourceCode("");

      const url = address.startsWith("0x")
        ? `https://api.bscscan.com/api?module=contract&action=getsourcecode&address=${address}&apikey=${DEMO_BSCSCAN_KEY}`
        : `https://api.etherscan.io/api?module=contract&action=getsourcecode&address=${address}&apikey=${DEMO_ETHERSCAN_KEY}`;

      const res = await fetch(url);
      const data = await res.json();

      if (!data.result || !data.result[0] || !data.result[0].SourceCode) {
        setError("‚ö†Ô∏è Kh√¥ng t√¨m th·∫•y m√£ ngu·ªìn h·ª£p ƒë·ªìng ho·∫∑c ch∆∞a ƒë∆∞·ª£c verify tr√™n BscScan/Etherscan.");
        return;
      }

      const code = data.result[0].SourceCode;
      setSourceCode(code);
      scanSource(code);
    } catch (err) {
      console.error(err);
      setError("L·ªói khi t·∫£i m√£ ngu·ªìn. Vui l√≤ng th·ª≠ l·∫°i ho·∫∑c ki·ªÉm tra API key.");
