  // =========================================
  function scanSource(code) {
    const warnings = {
      "To√†n b·ªô cung c·∫•p cho owner khi kh·ªüi t·∫°o": /_mint\s*\(\s*owner\s*\(\s*\)\s*,\s*totalSupply\s*\)/i.test(code),
      "C∆° ch·∫ø ch·∫∑n chuy·ªÉn (lock sell / transfer)": /_beforeTokenTransfer|MODE_TRANSFER_RESTRICTED|transferRestricted/i.test(code),
      "Owner c√≥ th·ªÉ b·∫≠t/t·∫Øt giao d·ªãch": /_mode\s*=|setMode|MODE_TRANSFER_CONTROLLED/i.test(code),
      "Ph√≠ cao ho·∫∑c thay ƒë·ªïi ƒë∆∞·ª£c b·ªüi dev": /setTaxFee|setBuyFee|setSellFee|updateFees/i.test(code),
      "C√≥ th·ªÉ ch·∫∑n b√°n qua h√†m custom": /(lock|blacklist|block|restrict)(Address|User|Trade)/i.test(code),
      "H·ª£p ƒë·ªìng Ownable (dev ki·ªÉm so√°t quy·ªÅn)": /contract\s+.*Ownable|onlyOwner/i.test(code),
    };

    setResults(warnings);
  }

  // =========================================
  // üé® Giao di·ªán hi·ªÉn th·ªã
  // =========================================
  return (
    <div style={{ padding: 20, fontFamily: "Arial", background: "#0a0a0a", color: "#fff", minHeight: "100vh" }}>
      <h2 style={{ color: "#4ade80" }}>üß© Tr√¨nh ki·ªÉm tra m√£ ngu·ªìn Token (Scam Detector Mini)</h2>

      <div style={{ marginTop: 20 }}>
        <input
          style={{
            width: "400px",
            padding: "10px",
            borderRadius: "8px",
            border: "1px solid #22c55e",
            background: "#111",
            color: "#fff",
          }}
          placeholder="D√°n ƒë·ªãa ch·ªâ token (0x...)"
          value={address}
          onChange={(e) => setAddress(e.target.value.trim())}
        />
        <button
          onClick={fetchSource}
          style={{
            marginLeft: 10,
            padding: "10px 20px",
            border: "none",
            borderRadius: "8px",
            background: "#22c55e",
            color: "#000",
            cursor: "pointer",
            fontWeight: "bold",
          }}
        >
          Ki·ªÉm tra
        </button>
      </div>

      {error && (
        <div
