      {results && (
        <div style={{ marginTop: 30 }}>
          <h3>üìã K·∫øt qu·∫£ ph√¢n t√≠ch:</h3>
          <ul>
            {Object.entries(results).map(([desc, found]) => (
              <li
                key={desc}
                style={{
                  marginTop: 10,
                  padding: 10,
